import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Tables from './components/Tables.js'
import Item from './components/Item.js';

function App() {
  return (
      <BrowserRouter>
          <Switch>
              <Route path="/" component={Table} exact />
              <Route path="/item/:number" component={Item} />
              <Tables></Tables>
          </Switch>
      </BrowserRouter>
  );
}


export default App;
